webpackJsonp([6435682793243],{2037:function(e,a){e.exports={pathContext:{docHtml:'<h1>array-unique <a href="http://badge.fury.io/js/array-unique"><img src="https://badge.fury.io/js/array-unique.svg" alt="NPM version"></a>  <a href="https://travis-ci.org/jonschlinkert/array-unique"><img src="https://travis-ci.org/jonschlinkert/array-unique.svg" alt="Build Status"></a></h1>\n<blockquote>\n<p>Return an array free of duplicate values. Fastest ES5 implementation.</p>\n</blockquote>\n<h2>Install with <a href="npmjs.org">npm</a></h2>\n<pre><code class="language-bash">npm i array-unique --save\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var unique = require(\'array-unique\');\n\nunique([\'a\', \'b\', \'c\', \'c\']);\n//=> [\'a\', \'b\', \'c\']\n</code></pre>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/jonschlinkert/arr-diff">arr-diff</a>: Returns an array with only the unique values from the first array, by excluding all values from additional arrays using strict equality for comparisons.</li>\n<li><a href="https://github.com/jonschlinkert/arr-union">arr-union</a>: Returns an array of unique values using strict equality for comparisons.</li>\n<li><a href="https://github.com/jonschlinkert/arr-flatten">arr-flatten</a>: Recursively flatten an array or arrays. This is the fastest implementation of array flatten.</li>\n<li><a href="https://github.com/jonschlinkert/arr-reduce">arr-reduce</a>: Fast array reduce that also loops over sparse elements.</li>\n<li><a href="https://github.com/jonschlinkert/arr-map">arr-map</a>: Faster, node.js focused alternative to JavaScript\'s native array map.</li>\n<li><a href="https://github.com/jonschlinkert/arr-pluck">arr-pluck</a>: Retrieves the value of a specified property from all elements in the collection.</li>\n</ul>\n<h2>Run tests</h2>\n<p>Install dev dependencies.</p>\n<pre><code class="language-bash">npm i -d &#x26;&#x26; npm test\n</code></pre>\n<h2>Contributing</h2>\n<p>Pull requests and stars are always welcome. For bugs and feature requests, <a href="https://github.com/jonschlinkert/array-unique/issues">please create an issue</a></p>\n<h2>Author</h2>\n<p><strong>Jon Schlinkert</strong></p>\n<ul>\n<li><a href="https://github.com/jonschlinkert">github/jonschlinkert</a></li>\n<li><a href="http://twitter.com/jonschlinkert">twitter/jonschlinkert</a> </li>\n</ul>\n<h2>License</h2>\n<p>Copyright (c) 2015 Jon Schlinkert<br>\nReleased under the MIT license</p>\n<hr>\n<p><em>This file was generated by <a href="https://github.com/assemble/verb-cli">verb-cli</a> on March 24, 2015.</em></p>',docPath:"argo-ci/node_modules/array-unique/readme",proj:"argo-ci"}}}});
